function getBase64ImgStr(img) {
	var base64Images = [
		{ id: 'fp_0', value: '' },
		{ id: 'fp_12', value: '' },
		{ id: 'fp_25', value: '' },
		{ id: 'fp_37', value: '' },
		{ id: 'fp_50', value: '' },
		{ id: 'fp_62', value: '' },
		{ id: 'fp_75', value: '' },
		{ id: 'fp_87', value: '' },
		{ id: 'fp_100', value: '' },
		{ id: 'fp_f', value: '' },
		{ id: 'fp_red', value: '' },
		{ id: 'fp_s', value: '' },
		{ id: 'PB510', value: '' }
	];
	
	var base65ImgStr;
	
	for(var i in base64Images) {
		if (base64Images[i].id == img) {
			base65ImgStr = base64Images[i].value;
			break;
		}
	}
	
    return 'data:image/png;base64,' + base65ImgStr;
}

function scanModalOnclick(action, titleHeader, title, prompt, percentage, img) {
	var scanModal = getScanModal();
	
	// Init the modal if it hasn't been already.
	if (!scanModal) { 
		scanModal = initScanModal(); 

		var html =
		'<div>' +
			'<div class="flex">' +
				'<button class="btn-close" id="btnCloseFPModal">x</button>' +
			'</div>' +
			'<div>' +
				'<h6 id="scanModalTitle">' + title + '</h6>' +
			'</div>' +
			'<div>' +
				'<div>' +
					'<img id="scanModalScoreIcon" width="80px" alt="InnaIT" />' +
				'</div>' +
				'<div class="hidden" id="scanModalScoreText">' +
					'0%' +
				'</div>' +
				'<div id="scanModalPrompt">' +
					prompt
				'</div>' +
			'</div>' +
		'</div>';
		
		setScanModalContent(html);
		
		if (img == 'ik')
			document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('fp_0');
		else if (img == 'pb510')
			document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('PB510');
	
		document.getElementById('btnCloseFPModal').onclick = function(){ 
			fetchApi.cancelResponse(function () {
				removeLS('lastMessageReceived');
				hideScanModal();  
			});
		};
	}
		
	percentage = Math.round(Number(percentage));
		
	if (action == 'SHOW_FINGERPRINT_GUI') {
		if (img == 'ik')
			document.getElementById("scanModalScoreText").classList.remove("hidden");
		
		document.getElementById("scanModalScoreText").innerHTML = "0%";
		
		document.getElementById("scanModalTitle").innerHTML = title;
		document.getElementById("scanModalPrompt").innerHTML = prompt;
		
		if (percentage > 0)
			document.getElementById("scanModalScoreText").innerHTML = percentage.toString() + '%';
		
		var template = 0;
		
		if (percentage > 0 && percentage <= 13) template = 12;
		else if (percentage > 13 && percentage <= 25) template = 25;
		else if (percentage > 25 && percentage <= 38) template = 37;
		else if (percentage > 38 && percentage <= 50) template = 50;
		else if (percentage > 50 && percentage <= 63) template = 62;
		else if (percentage > 63 && percentage <= 75) template = 75;
		else if (percentage > 75 && percentage <= 88) template = 87;
		else if (percentage >= 100) template = 100;
		
		if (img == 'ik')
			document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('fp_' + template.toString());
		else if (img == 'pb510')
			document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('PB510');
		
		setTimeout(function() {
			document.getElementById("scanModal").classList.remove("hidden");
		}, 200);
	}
	else if (action == 'SHOW_FINGERPRINT_RESULT') {
		document.getElementById("scanModalScoreText").classList.add("hidden");
		
		if (img == 'ik') {
			if (percentage > 0)
				document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('fp_s');
			else
				document.getElementById("scanModalScoreIcon").src = getBase64ImgStr('fp_red');
			
			document.getElementById("scanModalPrompt").innerHTML = prompt;
	 	}
	 	
		setTimeout(function() {
			document.getElementById("scanModal").classList.add("hidden");
		}, 200);
	}
}

function hideScanModal() {
	var scanModal = getScanModal();
	
	if (scanModal) 
		document.getElementById("scanModal").classList.add("hidden");
}

function getScanModal() {
  return document.getElementById('scanModal');
}

function setScanModalContent(html) {
	document.getElementById("scanModalContent").innerHTML = html;
}

function initScanModal() {
	var modal = document.createElement('div');
  
  	var css = '.scan-modal { text-align: center; justify-content: center; font-family: "Inter", sans-serif; padding: 1.3rem; border: 1px solid #f7f7f7; border-radius: 5px; top: 20%; left: 50%; min-width: 250px; position: fixed; box-shadow: 0px 0px 50px 1px #000; background-color: #666666 !important; color: #fff; z-index: 10000; transform: translate(-50%, 50%); } ' +
	' .hidden { display: none; }' +
	' .scan-modal .flex { text-align: right; margin: 10px 0 0 0; }' + 
	' .scan-modal .scan-modal-content { margin-top: -35px; }' + 
	' .scan-modal .flex .btn-close { transform: translate(10px, -20px); padding: 0px 7px 2px 7px; background: #666666; border-radius: 50%; color: #fff; border: 0px; }',
	head = document.head || document.getElementsByTagName('head')[0],
	style = document.createElement('style');
	head.appendChild(style);
	style.type = 'text/css';
	style.appendChild(document.createTextNode(css));	

	modal.innerHTML =
	'<div class="scan-modal hidden" id="scanModal">' +
	'<div class="scan-modal-content" id="scanModalContent"></div>' +
	'</div>';

	document.body.appendChild(modal);
	return modal;
}

function intiEnrollModal(enrollFpCount) {
	var enrollModal = document.getElementById('enrollModal');
	
	if (!enrollModal) {
		var modal = document.createElement('div');
	  
	  	var css = '.enroll-modal { text-align: center; justify-content: center; font-family: "Inter", sans-serif; padding: 1.3rem; border: 1px solid #f7f7f7; border-radius: 5px; top: 0%; left: 50%; min-width: 400px; position: absolute; background-color: #f9f9f9; z-index: 10000; transform: translate(-50%, 50%); } ' +
		' .hidden { display: none; }' +
		' .enroll-modal .flex { text-align: right; margin: 10px 0 0 0; }' + 
		' .enroll-modal .enroll-modal-content { margin-top: -35px; }' + 
		' .enroll-modal #enrollModalScoreIcon img { margin: 15px 5px 15px 5px; }' + 
		' .enroll-modal .tips { text-align: left; }' + 
		' .enroll-modal .flex .btn-close { transform: translate(10px, -20px); padding: 0px 7px 2px 7px; background: #666666; border-radius: 50%; color: #fff; border: 0px; }',
		head = document.head || document.getElementsByTagName('head')[0],
		style = document.createElement('style');
		head.appendChild(style);
		style.type = 'text/css';
		style.appendChild(document.createTextNode(css));	
	
		modal.innerHTML =
		'<div class="enroll-modal" id="enrollModal">' +
		'<div class="enroll-modal-content" id="enrollModalContent"></div>' +
		'</div>';
		
		document.body.appendChild(modal);
	
		var html =
		'<div>' +
			'<div class="flex">' +
				'<button class="btn-close" id="btnCloseEnrollModal">x</button>' +
			'</div>' +
			'<div>' +
				'<h4>Fingerprint Enrollment</h4>' +
				'<small>' + enrollFpCount + ' Fingerprint are required for complete enrollment.</small>' +
			'</div>' +
			'<div>' +
				'<div id="enrollModalScoreIcon">' +
				'</div>' +
				'<div class="tips" id="enrollModalFPTips" >' +
					'<h5>Registration Tips:</h5>' +
					'<h6>- Place and lift the same finger ' + enrollFpCount + ' time. Wait for <img src="' + getBase64ImgStr('fp_s') + '" width="30px" alt="InnaIT" /> to appear before lifting your finger.</h6>' +
					'<h6>- Keep finger flat</h6>' +
					'<h6>- Fully cover the scanner</h6>' +
				'</div>' +
			'</div>' +
		'</div>';
		
		document.getElementById("enrollModalContent").innerHTML = html;
		
		for (var i = 1; i <= enrollFpCount; i++) {
			var imgId = 'imgEnrollModalScoreIcon' + i;
			document.getElementById("enrollModalScoreIcon").innerHTML = 
			document.getElementById("enrollModalScoreIcon").innerHTML + '<img id="' + imgId + '" width="80px" alt="InnaIT" />';
			document.getElementById(imgId).src = getBase64ImgStr('fp_0');
		}
		
		document.getElementById('btnCloseEnrollModal').onclick = function() { 
			fetchApi.cancelResponse(function () {
				removeLS('lastMessageReceived');
				document.getElementById("enrollModal").classList.add("hidden"); 
			});
		};
	}
	else {
		for (var i = 1; i <= enrollFpCount; i++) {
			var imgId = 'imgEnrollModalScoreIcon' + i;
			document.getElementById(imgId).src = getBase64ImgStr('fp_0');
		}
		
		document.getElementById("enrollModal").classList.remove("hidden");
	}
}

function hideEnrollModal() {
	var enrollModal = document.getElementById('enrollModal');
	
	if (enrollModal) 
		document.getElementById("enrollModal").classList.add("hidden");
}

function getEnrollModalStatus() {
	var enrollModal = document.getElementById('enrollModal');
	
	if (enrollModal) {
		if (enrollModal.classList.contains('hidden'))
			return false;
		else
			return true;
	}
	else
		return false;
}

function setCaptureFpStatus(index, status) {
	var imgId = 'imgEnrollModalScoreIcon' + index;
	var img = document.getElementById(imgId);
	
	if (img)
		document.getElementById(imgId).src = getBase64ImgStr('fp_' + status);
}
